import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Try to find the Electronics category card in the main grid (prefer category card over nav links)
    // Use text selector inside .category-card for robustness
    const electronicsCard = await page.waitForSelector('.category-card:has-text("Electronics")', { timeout: 5000 });
    await electronicsCard.scrollIntoViewIfNeeded();
    await electronicsCard.click();

    // Wait for the category results to load (look for heading or category label)
    // Try to wait for an h2 or div with text "Electronics" or category-results container
    await page.waitForSelector('h2:has-text("Electronics"), .category-results:has-text("Electronics")', { timeout: 5000 });

    // Take screenshot after navigation
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_electronics_category.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_electronics_category.png'));

    // Extract the number of products displayed in the Electronics category
    // Try to find the results count element
    let productCount = null;
    const resultsCountEl = await page.$('.results-count');
    if (resultsCountEl) {
      const text = await resultsCountEl.textContent();
      const match = text && text.match(/(\d+)/);
      if (match) {
        productCount = parseInt(match[1], 10);
      }
    }

    // Extract the titles of the first 3 products in the grid/list
    let productTitles = [];
    const productTitleEls = await page.$$('.product-title');
    for (let i = 0; i < Math.min(3, productTitleEls.length); i++) {
      const title = await productTitleEls[i].textContent();
      if (title) productTitles.push(title.trim());
    }

    return {
      success: true,
      action: "Navigated to Electronics category via category card and verified product listing.",
      extractedData: {
        productCount,
        firstThreeProductTitles: productTitles
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
